declare const SQL_QUERY = "\nINSERT INTO Email (\n  \"email\", \"createdAt\", \"updatedAt\", \"deletedAt\", \"deliverable\", \"personId\"\n) VALUES (\n  @email, @createdAt, @updatedAt, @deletedAt, @deliverable, @personId\n)\nON CONFLICT (\"personId\", \"email\") DO UPDATE SET\n\"createdAt\" = MIN(@createdAt, \"createdAt\"), \"updatedAt\" = MAX(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"deliverable\" = IFNULL(@deliverable, \"deliverable\")\n";
export default SQL_QUERY;
